import React from 'react';

import {useSelector,  } from 'react-redux';


export default function WatchLater() {

    const state = useSelector((state)=>{

        return{
            
            later:state.YoutReducer.yout
        }
    })



    return ( 
        <>
<h2 className='subject'>Watch Later page</h2>

 {state.later.map((elm)=>(

<h2>{elm.later}</h2> 

 ))}

        </>
     );
}
